  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
} from "./HeaderStyle";


const Header = () => {
  return (
    <>
      <HeaderWrapper>
        <Wrapper>
        <Link to="/">
         <Logo   onClick={() => {
                window.scrollTo(0, 0);
              }}>CGV</Logo>
        </Link>
        <HeaderItemBar>
          <Headernav>영화</Headernav>
          <Headernav  onClick={() => {
                window.scrollTo(0, 0);
              }}>
          <Link to="/reservation">예매</Link>
          </Headernav>
          <Headernav>극장</Headernav>
        </HeaderItemBar>
        <Headernav>
          <HeaderLogin>로그인</HeaderLogin>
          </Headernav>
      </Wrapper>
      </HeaderWrapper>
    </>
  );
};

export default Header;
